import React from 'react';
import { Card, Box, Typography } from '@mui/material';
import ChampionImage from './ChampionImage';
import ItemList from './ItemList';
import KDAInfo from './KDAInfo';
import Team from './Team';

function Match({ match }) {
  if (!match) return null;

  const {
    champion,
    win,
    items,
    kills,
    deaths,
    assists,
    gameDuration,
    summonerSpells,
    runes,
    participants,
    version,
  } = match;

  const matchBgColor = win ? '#0d47a1' : '#b71c1c';

  return (
    <Card sx={{ backgroundColor: matchBgColor, color: '#f0f0f0', p: 2, mb: 2 }}>
      <Box display="flex" justifyContent="space-between" alignItems="center">
        <ChampionImage src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${champion}.png`} alt={champion} />

        <Box ml={2}>
          <Typography variant="h6">{win ? 'Victory' : 'Defeat'}</Typography>
          <KDAInfo kills={kills} deaths={deaths} assists={assists} />
          <Typography variant="caption">{gameDuration}</Typography>
        </Box>

        <ItemList items={items.concat(summonerSpells, runes)} version={version} />

        <Box display="flex" gap={2}>
          <Box>
            <Typography variant="subtitle2">Team 1:</Typography>
            <Team participants={participants.slice(0, 5)} version={version} />
          </Box>
          <Box>
            <Typography variant="subtitle2">Team 2:</Typography>
            <Team participants={participants.slice(5, 10)} version={version} />
          </Box>
        </Box>
      </Box>
    </Card>
  );
}

export default Match;
